        $gb->registerExtension(new \Oro\Bundle\DataGridBundle\Extension\Toolbar\ToolbarExtension());
        $gb->registerExtension(new \Oro\Bundle\DataGridBundle\Extension\GridViews\GridViewsExtension($zb));
        $gb->registerExtension($cc);
        $gb->registerExtension($eb);
        $gb->registerExtension($dc);
        $gb->registerExtension(new \Oro\Bundle\PimDataGridBundle\Extension\Pager\PagerExtension(new \Oro\Bundle\PimDataGridBundle\Extension\Pager\PagerResolver(new \Oro\Bundle\PimDataGridBundle\Extension\Pager\Orm\Pager(), new \Oro\Bundle\DataGridBundle\Extension\Pager\DummyPager(), [0 => 'product-grid', 1 => 'association-product-grid', 2 => 'association-product-model-grid', 3 => 'product-group-grid', 4 => 'association-product-picker-grid', 5 => 'published-product-grid', 6 => 'proposal-grid']), $zb));
        $gb->registerExtension($ec);

        return $container->services['oro_datagrid.datagrid.manager'] = new \Oro\Bundle\DataGridBundle\Datagrid\Manager($gb, ($container->privates['oro_datagrid.configuration.provider.chain'] ?? $container->load('getOroDatagrid_Configuration_Provider_ChainService')), $zb);
    }
}
